import React from 'react'

function Header() {
    return (
        <header>
            <h1>Ghibli Movies</h1>
            
            {/* <div>
                The Studio Ghibli API catalogs the people, places, and things found in the worlds of
                Ghibli.
            </div> */}
        </header>
    )
}

export default Header
